import React from 'react';

import { LineChart, Line, CartesianGrid, XAxis, YAxis, Tooltip } from 'recharts';
//TODO - add changing data to the graph
const data = [{name: '01/11/2024', open: 150, close: 151, High: 132, Low: 134}, {name: '31/10/2024', open: 234, close: 151, High: 132, Low: 134}, {name: '30/10/2024', Close: 111, High: 132, Low: 134}, {name: '29/10/2024', Close: 155, High: 132, Low: 134}];

const renderLineChart = (
  <LineChart width={1000} height={400} data={data} margin={{ top: 5, right: 20, bottom: 5, left: 0 }}>
    <Line type="monotone" dataKey="open" stroke="#8884d8" />
    <CartesianGrid stroke="#ccc" />
    <XAxis dataKey="name" />
    <YAxis />
    <Tooltip />
  </LineChart>
);

export function StockGraph() {
  return (
    <div className="StockGraph">
        <h1>FTSE100</h1>
      {renderLineChart}
    </div>
  );
}
